import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import "./Paymentcard.css";
const Paymentcard = () => {
  let navigatePage= useNavigate()
  return (
    <>
      <div className="pay_card" style={{ position: "sticky", top: "100px" }}>
        <div className="payment_card">
          <p className="notice">
            Hello Dear Student, <br /> 
            Please pay 20,000 for <b> Rapid Course of Amazon FBA </b>
            wholesale Please deposit to the account number below and don't
            forget to fill out this form and upload the screenshot of your
            payment receipt in this form here:
            <Link onClick={() => {
              navigateToPage("https://form.jotform.com/222736750314453");
            }}>https://form.jotform.com/222736750314453</Link>
          </p>
        </div>
      </div>
    </>
  );
};

export default Paymentcard;
